import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import "../style/home-banner.css";

const HomeBanner = () => {
  return (
    <Row className="align-items-center justify-content-center">
      <Col
        sm={{ span: 12, order: 1 }}
        md={{ span: 6, order: 2 }}
        className="home-banner banner-image"
      >
        <div className="image-container">
          {" "}
          <img
            className="mx-auto d-block"
            src="https://aish.s3.eu-west-2.amazonaws.com/public/files/uploads/4e195bc5afe06f8195f630c6e797548f71dd0bd1.png"
            alt="img of pug in pink circle"
          />
        </div>
      </Col>
      <Col
        sm={{ span: 12, order: 2 }}
        md={{ span: 6, order: 1 }}
        className="home-banner banner-header"
      >
        Find your dream Pet here
      </Col>
    </Row>
  );
};

export default HomeBanner;
